/*!50003 CREATE*/ /*!50017 DEFINER=`rootdev`@`%`*/ /*!50003 TRIGGER `calls_after_insert` AFTER INSERT ON `calls` FOR EACH ROW BEGIN

	-- For Reporter Report Call Update
	-- SET @check_report = (SELECT COUNT(report_call_update.id) FROM report_call_update WHERE DATE(call_date) = DATE(NEW.call_date) AND direction=NEW.direction_id);
	-- IF (@check_report = 0) THEN
   --  INSERT INTO report_call_update SET call_date = NEW.call_date,direction = NEW.direction_id,is_update = 1,is_uptodate = 0,date_update = NOW(),created = NEW.call_date; 
	-- END IF;
	 
	-- For Reporter Report Call Performance
	IF NEW.user_id IS NOT NULL AND NEW.user_id > 0 THEN
		SET @check_user = (SELECT COUNT(report_call_user_update.id) FROM report_call_user_update WHERE DATE(call_date) = DATE(NOW()) 
		AND user_id = NEW.user_id AND direction = NEW.direction_id);
	    IF(@check_user = 0) THEN
	        INSERT INTO report_call_user_update SET 
			  user_id = NEW.user_id
			  ,username = (SELECT username FROM users WHERE id=NEW.user_id)
			  ,call_date = NOW()
			  ,direction = NEW.direction_id
			  ,is_update = 1
			  ,is_uptodate = 0
			  ,date_update = NOW()
			  ,created = NOW();
		ELSE 
			  	UPDATE report_call_user_update
      		SET is_update=1,is_uptodate=0,date_update=NOW()
      		WHERE call_date IS NOT NULL AND DATE(call_date)=NOW() AND user_id=NEW.id;
		END IF;

	END IF;
	
	
END */;;
