INSERT INTO `email_contents` VALUES (1,2,'BREAKING NEWS BRING_CERIA','<p>Kepada Yth : &lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;phone_2&gt;&gt;</p><p>&lt;&lt;card_number&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;amount&gt;&gt;</p><p>&lt;&lt;office_address&gt;&gt;</p><p>&lt;&lt;home_address&gt;&gt;</p><p><br></p><p>Pada bulan ini kami dari BRI, mengadakan campaign Bring Ceria untuk seluruh nasabah yang terpilih. Bapak/Ibu akan mendapatkan benefit yang maksimal.</p><p><br></p><p>Test ...Test</p><p><br></p><p>Salam</p><p>PMO</p>',1),(2,4,'XTRA VAGANZA 2021 TELAH DIBUKA','<p>Kepada Yth : #fullname#</p><p><br></p><p>#phone_1#</p><p>#phone_2#</p><p>&lt;&lt;amount&gt;&gt;</p><p>&lt;&lt;office_address&gt;&gt;</p><p>&lt;&lt;home_address&gt;&gt;</p><p><br></p><p><br></p><p>terima kasih sudah bergabung dengan campaign Xtra vaganzaaaaaa 2021</p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">Namun yang perlu dingat, fokuslah pada satu item saja dalam satu email. Alasannya Anda bisa menempatkan informasi yang cukup tentang produk Anda. Selain itu menampilkan terlalu banyak produk sekaligus dalam satu emaill dapat menjadikan pembaca email Anda bingung dan tidak fokus.</span></p><p><br></p><p>Test Test</p><p><br></p><p>Salam,</p><p><br></p><p>PMO</p><p><br></p><p>Salam,</p><p><span style=\"color: rgb(31, 73, 125);\">&nbsp;</span></p><p><span style=\"color: rgb(68, 114, 196);\"><img src=\"/attachment/inline?data=ml9NXQyTe267EOsIlVjyOA3FgA9CJEHJ1LPxdj9M0y5uqggJq8nT0eHW5o72zfBPMTjkVc%2b1FXpN69oHzQOBoCbCq5HpFWx8AMGn6z7dLjPbw18Z8FOn2%2fED8pY5d575&amp;cid=image001.png@01D7DD2D.2264D7E0\"></span></p><p><span style=\"color: rgb(68, 114, 196);\">Franciskus Simanullang</span></p><p><span style=\"color: gray;\">Information Technology Division I Project Management Office Dept I Gedung JSM 4th Floor&nbsp;Jl. Cideng Barat No.76 Jakarta Pusat 10150 I Phone 62-21 29292929 Ext.9190 I</span></p><p><span style=\"color: gray;\">e-mail: </span><a href=\"mailto:frans@jsm.co.id\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 114, 196);\"><u>frans@jsm.co.id</u></a><span style=\"color: gray;\">&nbsp;I Website: </span><a href=\"http://www.jsm.co.id/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 114, 196);\"><u>www.jsm.co.id</u></a></p>',1),(3,10,'BRING SALE 0 %','<p>Kepada YTH,</p><p>&lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;phone_2&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;card_number&gt;&gt;</p><p>&lt;&lt;amount&gt;&gt;</p><p>&lt;&lt;home_address&gt;&gt;</p><p>&lt;&lt;office_address&gt;&gt;</p><p><br></p><p>Kami mmemberikan info untuk program Bring email 0%</p><p><br></p><p>Salam,</p><p>Bank BRI</p><p><br></p><p>Berminat mengikuti program BRING 0%</p><p>YES NO</p>',1),(4,12,'DesemberMail2021','<p>To,</p><p><br></p><p>&lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;card_number&gt;&gt;</p><p>&lt;&lt;amount&gt;&gt;</p><p>&lt;&lt;home_address&gt;&gt;</p>',1),(5,14,'BRI OK MAIL DES 2021','<p>Hi Customer, </p><p>&lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;amount&gt;&gt;</p><p>&lt;&lt;office_address&gt;&gt;</p><p>&lt;&lt;card_number&gt;&gt;</p><p><br></p><p><br></p>',1),(6,15,'TEST IS ACTIVE','<p>HELLO,</p><p>&lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;card_number&gt;&gt;</p><p>&lt;&lt;amount&gt;&gt;</p><p>&lt;&lt;office_address&gt;&gt;</p>',1),(7,16,'TESTTTT EMAILL','<p>DEAR &lt;&lt;fullname&gt;&gt;</p><p>Yang mempunyai nomer telpon : &lt;&lt;phone_1&gt;&gt;</p><p>Dan alamat email : &lt;&lt;email&gt;&gt;</p><p>Dengan amount : &lt;&lt;amount&gt;&gt;</p><p>Dan nama bank : &lt;&lt;bank_name&gt;&gt;</p>',1),(8,18,'UNTUK REVOKE','<p>HALO,</p><p><br></p><p>&lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;amount&gt;&gt;</p><p>&lt;&lt;office_address&gt;&gt;</p>',1),(9,19,'TEST REVOKE','<p>HELOO,</p><p><br></p><p>&lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;card_number&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p>',1),(10,20,'TEST REVOKE','<p>HAAAII,</p><p><br></p><p>&lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;card_number&gt;&gt;</p><p>&lt;&lt;amount&gt;&gt;</p>',1),(11,24,'CUMA TEST','<p>Halo kawan - kawanku</p><p><br></p><p><br></p><p>&lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;phone_2&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;card_type&gt;&gt;</p>',1),(12,30,'KPR BRI : Punya Rumah Auto Keren','<p>Kepada Yth :</p><p>&lt;&lt;fullname&gt;&gt;</p><p><br></p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;home_address&gt;&gt;</p><p>&lt;&lt;office_address&gt;&gt;</p><p><br></p><p>Kami dari BRI ingin memberikan informasi Gebyar Januari yaitu sbb :</p><p>KPR BRI : Punya Rumah Auto Keren</p><p><br></p><p>Ajukan KPR BRI secara online melalui BRIspot.</p><p>Dapat diakses langsung oleh calon debitur.</p><p><br></p><p>Cepat, Mudah, Transparan</p><p><br></p><p>Cepat : rangkaian pengajuan melalui BRIspot hanya butuh waktu hitungan menit, sudah meliputi inputasi data pribadi, data keuangan, data properti yg diajukan dan pilihan unit kerja BRI yang akan melayani.</p><p><br></p><p>Mudah:</p><p>Aplikasi berbasis platform digital yg dirancang sangat user friendly untuk&nbsp;para pengguna smartphone, dapat dilakukan di mana saja, kapan saja.</p><p><br></p><p>Transparan :</p><p>Proses pengajuan kredit bersifat transparan karena debitur dapat langsung melakukan monitoring proses pegnajuan secara live melalui fitur-fitur yang sudah disediakan BRIspot dengan rincian Fitur sbb :</p><p>- Pengajuan</p><p>- Simulasi Angsuran</p><p>- Tracking Pengajuan : calon debitur dapat memeriksa posisi pengajuan KPRnya, yakni : pengajuan, analisa &amp; verifikasi, menunggu putusan, pencairan</p><p>Untuk informasi lebih lanjut, hubungi Contact BRI 14017/ 1500017.</p><p><br></p><p><br></p><p><img src=\"https://bri.co.id/documents/36847/560ca224-d94d-990f-4576-c4d2547c0dcb?download=false\"></p>',1),(13,34,'Campaign Media EMail Januari 2022','<p>Kepada Yth Customer Campaign,</p><p>Pemasaran email adalah tindakan mengirimkan pesan komersial, biasanya ke sekelompok orang, menggunakan email.</p><p><br></p><p>&lt;&lt;fullname&gt;&gt;</p><p>&lt;&lt;phone_1&gt;&gt;</p><p>&lt;&lt;phone_2&gt;&gt;</p><p>&lt;&lt;email&gt;&gt;</p><p>&lt;&lt;card_number&gt;&gt;</p><p>&lt;&lt;amount&gt;&gt;</p><p><br></p><p>Salam,</p><p>Team</p><p><br></p><p><br></p>',1),(14,41,'for your honor','<p>yang terhormat</p><p>&lt;&lt;fullname&gt;&gt;</p>',1);
