erti yg diajukan dan pilihan unit kerja BRI yang akan melayani.</p><p><br></p><p>Mudah:</p><p>Aplikasi berbasis platform digital yg dirancang sangat user friendly untuk&nbsp;para pengguna smartphone, dapat dilakukan di mana saja, kapan saja.</p><p><br></p><p>Transparan :</p><p>Proses pengajuan kredit bersifat transparan karena debitur dapat langsung melakukan monitoring proses pegnajuan secara live melalui fitur-fitur yang sudah disediakan BRIspot dengan rincian Fitur sbb :</p><p>- Pengajuan</p><p>- Simulasi Angsuran</p><p>- Tracking Pengajuan : calon debitur dapat memeriksa posisi pengajuan KPRnya, yakni : pengajuan, analisa &amp; verifikasi, menunggu putusan, pencairan</p><p>Untuk informasi lebih lanjut, hubungi Contact BRI 14017/ 1500017.</p><p><br></p><p><br></p><p><img src=\"https://bri.co.id/documents/36847/560ca224-d94d-990f-4576-c4d2547c0dcb?download=false\"></p>',NULL,NULL,NULL,NULL,2,1,'1',30,189,'2022-01-12 04:00:43',16,NULL,NULL,'0'),(72,2,'2022-01-12 11:00:48','KPR BRI : Punya Rumah Auto Keren',NULL,'frans@jsm.co.id',NULL,NULL,'<p>Kepada Yth :</p><p>Franciskus Simanullang</p><p><br></p><p>088212402737</p><p>frans@jsm.co.id</p><p>cidengbarat 76 lt 5</p><p>Jalan Tanah Abang 2</p><p><br></p><p>Kami dari BRI ingin memberikan informasi Gebyar Januari yaitu sbb :</p><p>KPR BRI : Punya Rumah Auto Keren</p><p><br></p><p>Ajukan KPR BRI secara online melalui BRIspot.</p><p>Dapat diakses langsung oleh calon debitur.</p><p><br></p><p>Cepat, Mudah, Transparan</p><p><br></p><p>Cepat : rangkaian pengajuan melalui BRIspot hanya butuh waktu hitungan menit, sudah meliputi inputasi data pribadi, data keuangan, data properti yg diajukan dan pilihan unit kerja BRI yang akan melayani.</p><p><br></p><p>Mudah:</p><p>Aplikasi berbasis platform digital yg dirancang sangat user friendly untuk&nbsp;para pengguna smartphone, dapat dilakukan di mana saja, kapan saja.</p><p><br></p><p>Transparan :</p><p>Proses pengajuan kredit bersifat transparan karena debitur dapat langsung melakuk