INSERT INTO `settings` VALUES (1,'TICKET_FILE_SIZE','Maximum file size for ticket attachment (in mb)','5'),(2,'RUNNING_TEXT','Running text pada aplikasi desktop','J Trust Co. Ltd. (J Trust), Sebuah perusahaan holding dengan lingkup operasi global yang beralamat di Toranomon First Garden, 1-7-12 Toranomon, Minato-ku, Tokyo 105-0001, terpilih sebagai pemenang diantara 11 peminat dalam proses divestasi Bank Mutiara (Perseroan) yang sebelumnya berada dibawah kontrol Lembaga Penjamin Simpanan (LPS). Perjanjian jual beli kondisional antara LPS dan J Trust yang telah ditandatangani dan berlaku efektif setelah Rapat Umum Pemegang Saham Luar Biasa (RUPSLB) Perseroan tanggal 20 November 2014, memungkinkan J Trust untuk memiliki mayoritas saham Perseroan dengan dikecualikan dari regulasi pembatasan 40% kepemilikan saham Asing pada bank umum komersial di Indonesia. RUPSLB tersebut menjadikan J Trust sebagai pemilik saham 99% dari Perseroan setelah sebelumnya LPS mendapat surat persetujuan Otoritas Jasa Keuangan (OJK) yang diterima pada 10 November 2014.\r\n\r\nSetelah menjadi pemilik saham utama, J Trust mengirimkan perwakilan terbaiknya untuk meningkatkan kemampuan dan merestrukturisasi Perseroan. Setelah berbagai pembenahan internal dan konsolidasi dengan berbagai perusahaan dibawah naungan J Trust, Perseroan merubah nama menjadi PT BANK JTRUST INDONESIA Tbk. melalui RUPSLB tanggal 30 Maret 2015. Setelah mendapat persetujuan Kementerian Hukum dan Hak Asasi Manusia tanggal 7 April 2015, dan persetujuan OJK tanggal 21 Mei 2015, PT BANK JTRUST INDONESIA Tbk resmi diumumkan ke publik pada 29 Mei 2015. Pengumuman tersebut adalah awal kehadiran J Trust Bank yang hadir untuk memberikan pelayanan berkualitas dengan standar Jepang kepada masyarakat di Indonesia dan Asia Tenggara.'),(3,'SMS_CONFIG','SMS API configuration','{\"url\":\"http:\\/\\/localhost\\/MTPush\",\"header_auth\":\"Basic 12345\",\"keyword\":\"Ini keyword\"}'),(4,'EMAIL_OUTBOUND_CONFIG','Email outbound API configuration','{\"auth_url\":\"http:\\/\\/192.168.10.105:20000\\/token\",\"send_url\":\"http:\\/\\/192.168.10.105:20001\\/post\\/sendemail\",\"client_id\":\"Helpdesk\",\"username\":\"usr_helpdesk\",\"password\":\"helpdeskpass123\"}');
/*!40000 ALTER TABLE `settings` ENABLE KEYS */;
UNLOCK TABLES;

