/*!50003 CREATE*/ /*!50017 DEFINER=`rootdev`@`%`*/ /*!50003 TRIGGER `user_before_update` BEFORE UPDATE ON `users` FOR EACH ROW BEGIN
	IF (NEW.user_activity_id <> OLD.user_activity_id) THEN
  
		    IF (OLD.last_event_id IS NOT NULL) THEN
		    		SET @duration = TIMEDIFF(NOW(), OLD.last_activity_time);
		      	UPDATE user_events SET duration= @duration, duration_int=TIME_TO_SEC(@duration) WHERE id=OLD.last_event_id; 
		    END IF;
		    
		    SET @isLogin = 0;
		    SET @isLogout = 0;
		    SET @currentTime = NOW();
		    
		    IF (NEW.user_activity_id = 2) THEN
		    		SET @isLogin = 1;
		    END IF;
		    
		    IF (NEW.user_activity_id = 1) THEN
		    		SET @isLogout = 1;
		    END IF;	    
		  
		    INSERT INTO user_events
		    (
			      user_events.event_date
			     
			      ,user_events.user_id
			      ,user_events.user_activity_id
			      ,user_events.user_level_id
			      ,user_events.host
			      ,user_events.ip_address
			      ,user_events.extension
			      ,user_events.is_login
			      ,user_events.is_logout
		    )
		    VALUES
		    (
			      @currentTime
			     
			      ,NEW.id
			      ,NEW.user_activity_id
			      ,NEW.user_level_id
			      ,NEW.host_address
			      ,NEW.ip_address
			      ,NEW.ext_inbound
			      ,@isLogin
			      ,@isLogout
		    );
		    	     
		  
		    SET NEW.last_event_id = LAST_INSERT_ID();
				
				INSERT INTO user_escort (
			user_escort.user_id,
			user_escort.activity_date,
			user_escort.username,
			user_escort.fullname,
			user_escort.ext_in,
			user_escort.ext_out,
			user_escort.duration,
			user_escort.user_activity,
			user_escort.user_level,
			user_escort.break_time,
			user_escort.first_login,
			user_escort.last_logout,
			user_escort.total_login,
			user_escort.login_duration ,
			user_escort.available_duration
		)
		VALUES
			(
				NEW.id,
				NOW( ),
				NEW.username,
				NEW.fullname,
				NEW.ext_inbound,
				NEW.ext_outbound,
				TIMEDIFF( NOW( ), OLD.last_activity_time ),
				( SELECT user_activities.NAME FROM user_activities WHERE user_activities.id = OLD.user_activity_id ),
				( SELECT user_levels.NAME FROM user_levels WHERE user_levels.id = NEW.user_level_id ),
				(
				SELECT
					user_events.event_date 
				FROM
					user_events 
				WHERE
					DATE( user_events.event_date ) = CURDATE( ) 
					AND user_events.user_id = NEW.id 
					AND OLD.user_activity_id = 6 
				ORDER BY
					id DESC 
					LIMIT 1 
				),
				(
				SELECT
					user_events.event_date 
				FROM
					user_events 
				WHERE
					DATE( user_events.event_date ) = CURDATE( ) 
					AND user_events.user_id = NEW.id 
					AND NEW.user_activity_id > 1 
				ORDER BY
					user_events.id ASC 
					LIMIT 1 
				),
				(
				SELECT
					user_events.event_date 
				FROM
					user_events 
				WHERE
					DATE( user_events.event_date ) = CURDATE( ) 
					AND user_events.user_id = NEW.id 
					AND NEW.user_activity_id = 1 
				ORDER BY
					user_events.id DESC 
					LIMIT 1 
				),
				(
				SELECT
					count( * ) 
				FROM
					user_events 
				WHERE
					DATE( user_events.event_date ) = CURDATE( ) 
					AND user_events.user_id = NEW.id 
					AND user_events.user_activity_id = 14 
					AND user_events.is_login = 1 
				ORDER BY
					user_events.id DESC 
					LIMIT 1 
				),
				(
				SELECT
					sec_to_time( sum( time_to_sec( user_events.duration ) ) ) 
				FROM
					user_events 
				WHERE
					DATE( user_events.event_date ) = CURDATE( ) 
					AND user_events.user_id = NEW.id 
					AND user_events.user_activity_id > 1
				ORDER BY
					user_events.id ASC 
					LIMIT 1 
				) ,
				(
				SELECT
					sec_to_time( sum( time_to_sec( user_events.duration ) ) ) 
				FROM
					user_events 
				WHERE
					DATE( user_events.event_date ) = CURDATE( ) 
					AND user_events.user_id = NEW.id 
					AND user_events.user_activity_id = 8
				ORDER BY
					user_events.id ASC 
					LIMIT 1 
				) 
			);		
  END IF;		
			
			
		
		
		


END */;;
DELIMITER ;
