/*!50003 CREATE*/ /*!50017 DEFINER=`rootdev`@`%`*/ /*!50003 TRIGGER `users_after_update` AFTER UPDATE ON `users` FOR EACH ROW BEGIN
 
	-- For Reporter Report Call Activity 
	-- 1=OFFLINE, 2=Not Available, 8=OUTBOUND CALL
	IF (NEW.user_activity_id = 2) OR (NEW.user_activity_id = 1) OR (NEW.user_activity_id = 8) THEN
		
		SET @check_user = (SELECT COUNT(report_call_user_update.id) FROM report_call_user_update 
		WHERE DATE(call_date) = DATE(NEW.last_activity_time) AND user_id = NEW.id );
		
	    IF(@check_user = 0) THEN
	        INSERT INTO report_call_user_update SET 
			  user_id = NEW.id
			  ,call_date = NOW()
			  ,username = (SELECT users.username FROM users where users.id = NEW.id)
			  ,is_update = 1
			  ,is_uptodate = 0
			  ,date_update = NOW()
			  ,created = NOW(); 
		END IF;
		
	   UPDATE report_call_user_update
      SET is_update=1,is_uptodate=0,date_update=NOW()
      WHERE call_date IS NOT NULL AND DATE(call_date)=NOW() AND user_id=NEW.id;
      
	END IF;
	
END */;;
DELIMITER ;
